function replace_expr(expr::Expr, x)
    if Base.Meta.isexpr(expr, :ref)
        return x[expr.args[2]]
    end
    for i in 1:length(expr.args)
        expr.args[i] = replace_expr(expr.args[i], x)
    end
    return expr
end

